	add("guan", "{\"term\":\"guan\", \"etymology\":{\"influencers\":[], \"languages\":[\"san blas kuna\", \"English\", \"Spanish\"], \"text\":\"From American Spanish \u0026lt;ref\u0026gt;{{R:Dictionary.com}}\u0026lt;/ref\u0026gt; from San blas kuna lt;ref\u0026gt;\u0027\u00271999\u0027\u0027, Allan A. Metcalf, \u0027The World in So Many Words: A Country-By-Country Tour of Words\u0027, page 217\u0026lt;/ref\u0026gt; \u0027kwama\u0027 \u0026lt;ref\u0026gt;{{R:Merriam-Webster Unabridged}}\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any (member) of several species of birds in the genera \u0027Aburria\u0027, \u0027Chamaepetes\u0027, \u0027Oreophasis\u0027, \u0027Penelope\u0027, \u0027Penelopina\u0027 and \u0027Pipile\u0027, of the family Cracidae, limited to the Americas\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Daniel M. Brooks, Stuart D. Strahl, \u0027Curassows, Guans and Chachalacas: With Spanish and Portuguese Translations\u0027, [https://books.google.com.au/books?id\u003dxp03unX-6w8C\u0026amp;pg\u003dPA8\u0026amp;dq\u003d%22guans%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22guans%22\u0026amp;f\u003dfalse page 8\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The \u0027true\u0027 (\u0027Penelope\u0027) \u0027\u0027guans\u0027\u0027 also occur at a range of altitudes but like most species of cracids, are mostly restricted to forest, both montane and lowland. Piping-\u0027\u0027guans\u0027\u0027 (\u0027Pipile\u0027) are primarily lowland species, whereas numerous monospecific (single-species genus) taxa of \u0027\u0027guans\u0027\u0027 (i.e. \u0027Aburria\u0027, \u0027Penelopina\u0027, \u0027Oreophasis\u0027) are restricted to montane environments\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Kent H. Redford, Peter Feinsinger, \u002717: The half-empty forest: sustainable use and the ecology of interactions\u0027, John D. Reynolds (editor), \u0027Conservation of Exploited Species\u0027, [https://books.google.com.au/books?id\u003dW8WldjwSjZYC\u0026amp;pg\u003dPA381\u0026amp;dq\u003d%22guans%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22guans%22\u0026amp;f\u003dfalse page 381\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Most \u0027\u0027guans\u0027\u0027 move among only the most rewarding trees, those having the largest fruit crops and/or the greatest reward per fruit. Nevertheless, solitary individuals and some \u0027\u0027guan\u0027\u0027 groups - as well as the first-mentioned guans, once they deplete the fruit crops in the most popular trees - are stuck with the less rewarding trees\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Carrol L. Henderson, \u0027Birds of Costa Rica: A Field Guide\u0027, [https://books.google.com.au/books?id\u003dTxpqRO8dB8AC\u0026amp;pg\u003dPA40\u0026amp;dq\u003d%22guan%22%7C%22guans%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22guan%22%7C%22guans%22\u0026amp;f\u003dfalse page 40\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The Crested \u0027\u0027Guan\u0027\u0027 is a large, brown, turkeylike bird most frequently seen peering down from the treetops as it searches for fruit an leaves that make up its diet. As its name implies, this bird has a feathered crest that is frequently raised as it relates to nearby \u0027\u0027guans\u0027\u0027 or to potential danger\", \"priority\":10}]}, \"synonyms\":{}}");

