	add("guanxi", "{\"term\":\"guanxi\", \"etymology\":{\"influencers\":[], \"languages\":[\"mandarin chinese\", \"English\"], \"text\":\"From Mandarin chinese {{zh-l|關係}} (guānxi\u0026lt;!---xi is neutral tone when used in this sense (connections, who you know) ---\u0026gt;), literally relation connection.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"In the context of Chinese society) Connections; relationships; one\u0027s social or business network\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"To open a new business in China you need \u0027\u0027\u0027guanxi\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027, James O\u0027Reilly, Sean O\u0027Reilly, Larry Habegger (editors), \u0027Travellers\u0027 Tales - Hong Kong\u0027 [http://books.google.co.uk/books?vid\u003dISBN1885211031\u0026amp;id\u003dDMy8ANLFJPoC\u0026amp;pg\u003dPA384\u0026amp;lpg\u003dPA384\u0026amp;dq\u003d%22good+guanxi%22\u0026amp;sig\u003d2k-Am3GuY0OcYkPm3AGblSfFiC0\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Who would dare to drive around in a [right-hand drive] car that was so obviously stolen and smuggled into the country? The police, of course! And Communisty Party officials. And those with \u0027\u0027\u0027guanxi\u0027\u0027\u0027 with the police\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1998\u0027\u0027, Stuart Cohen, \u0027Invisible World\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"By chance he\u0027d happened to be in Hong Kong when Clayton had died, and his \u0027\u0027\u0027guanxi\u0027\u0027\u0027 had smoothed out the paperwork that could have delayed things for weeks\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Yadong Luo, \u0027Strategy, Structure, and Performance of MNCs in China\u0027 [http://books.google.com/books?vid\u003dISBN156720385X\u0026amp;id\u003dxi3amIAV1sEC\u0026amp;pg\u003dPA56\u0026amp;lpg\u003dPA56\u0026amp;dq\u003dguanxi\u0026amp;sig\u003dpej1VNMjpDiO9bWHrXnlEbUKV_I\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"It should be noted that the existence of a basis for \u0027\u0027\u0027guanxi\u0027\u0027\u0027 does not imply that such an alliance will develop\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, [http://www.cbbc.org/market_intelligence/challenge/guanxi.html China-Britain Business Council\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Many foreigners claim to have \u0027\u0027\u0027guanxi\u0027\u0027\u0027 with their Chinese counterparts; few actually do\", \"priority\":10}]}, \"synonyms\":{}}");

