	add("guaranty", "{\"term\":\"guaranty\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"German\", \"English\", \"frankish\", \"old french (842-ca. 1400)\", \"middle low german\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027guarantie\u0027 from Old french (842-ca. 1400) \u0027guarantie\u0027 (protection, defense) from Old french (842-ca. 1400) \u0027garantir\u0027 \u0027guarantir\u0027 (to warrant, vouch for something) from Old french (842-ca. 1400) \u0027garant\u0027 \u0027guarant\u0027 \u0027warant\u0027 (a warrant; warranter, supporter, defender, protector) from Frankish {{m|frk|*warand}}, {{m|frk|*warjand||a warrant}}, from Frankish {{m|frk|*warjan||to fend for, designate something as true, vouch for}}, from Proto-germanic {{m|gem-pro|*warjaną||to defend, protect}}, from Proto-indo-european {{m|ine-pro|*wer-||to close, cover, protect, save, defend}}. Cognate with Middle low german \u0027warent\u0027 \u0027warend\u0027 (a warrant) German \u0027gewähren\u0027 (to grant) More at {{l|en|warrant}}. Compare \u0027guarantee\u0027 \u0027warranty\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An undertaking to answer for the payment of some debt, or the performance of some contract or duty, of another, in case of the failure of such other to pay or perform; a warranty; a security\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Something serving as a security for such an undertaking\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An assurance or guarantee\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1945\u0027\u0027, “[http://www.jstor.org/stable/2988964 The Philosophical Basis of Masaryk’s Political Ideals]” in \u0027w:Ethics Ethics\u0027 LV, № 4 (July 1945), page 299, right column\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The concept of God and immortality is for him a \u0027\u0027guaranty\u0027\u0027 of this eternal difference between right and wrong\", \"priority\":5}]}, \"synonyms\":{}}");

	add("guarder", "{\"term\":\"guarder\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|guard|er|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who guards; a guard\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"II.27\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"they found themselves in view of the town, whence the night before they had hoised sailes, where they were pursued by the \u0027\u0027guarders\u0027\u0027 and Souldiers of the Port\", \"priority\":3}]}, \"synonyms\":{}}");

	add("guardian", "{\"term\":\"guardian\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Proto-Germanic\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027guardein\u0027 from Old french (842-ca. 1400) \u0027*guardian\u0027 () \u0027gardein\u0027, \u0027garden\u0027, *\u0027gardenc\u0027, from the verb \u0027guarder\u0027 of Proto-germanic origin. Compare French \u0027gardien\u0027 See also the English doublet \u0027warden\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Someone who guards, watch watches over, or protects\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A person legally responsible for a minor (in loco parentis\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A person legally responsible for an incompetent person\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A superior in a Franciscan monastery\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A major or final enemy; boss\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1993\u0027\u0027, Zach Meston, J. Douglas Arnold, \u0027Awesome Super Nintendo Secrets 2\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Secret weak points of bosses/\u0027\u0027guardians\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, James Newman, \u0027Videogames\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"if you tell me how to find the secret door in level three, I\u0027ll tell you how to defeat the end of level \u0027\u0027guardian\", \"priority\":9}]}, \"synonyms\":{}}");

	add("guardianship", "{\"term\":\"guardianship\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|guardian|ship|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The office or position of one acting as a guardian or conservator, especially in a legal capacity\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1986\u0027\u0027 Philip Bean, \u0026quot;Mental Disorder and Legal Control\u0026quot; - Page 8\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An application for \u0027\u0027guardianship\u0027\u0027 must be founded on two medical recommendations, the procedure being similar to an application for admission for treatment\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Forbidden to you are your mothers and your daughters and your sisters and your paternal aunts and your maternal aunts and brothers\u0027 daughters and sisters\u0027 daughters and your mothers that have suckled you and your foster-sisters and mothers of your wives and your step-daughters who are in your \u0027\u0027guardianship\u0027\u0027, (born) of your wives to whom you have gone in, but if you have not gone in to them, there is no blame on you (in marrying them), and the wives of your sons who are of your own loins and that you should have two sisters together, except what has already passed; surely Allah is Forgiving, Merciful.\u0027 Qur\u0027an, \u0027The Women\u0027, 4.23 (M.H. Shakir translation\", \"priority\":4}]}, \"synonyms\":{}}");

