	add("guava", "{\"term\":\"guava\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"arawak\", \"English\", \"Spanish\"], \"text\":\"Recorded since 1555, from Spanish \u0027guaya\u0027 a variant of \u0027guayaba\u0027 from Arawak \u0027guayabo\u0027 (guava tree)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A tropical tree or shrub of the myrtle family, \u0027Psidium guajava\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Its yellowish tropical fruit, 1¼ to 2 inches, globular or pear-shaped with thin, yellow, green or brown skin, is often made into jams and jellies. The meat is yellowish or pale green to pink in color\", \"priority\":2}]}, \"synonyms\":{}}");

